import Logo from './components/Logo';
import Button from './components/Button';
import Headline from './components/Headline';
import Gallery from './components/Gallery';




function App() {
  return (

    <div className="App">
      <Logo />
      <Button />
      <CustomButton btnText="Verda Salon" url="https://www.verdesalon.ca/"/>
      <CustomButton btnText="Beauty and Bridal Boutique" url= "https://www.gettingalldolledup.com/" />
      <Headline />
      <Gallery />


    </div>
  );
}

export default App;
